INSERT INTO `event` VALUES (3,'2111-04-6','Stage GM Lee Kwan Young','Nous aurons une nouvelle fois l\'honneur d\'accueillir à Olivet Maître LEE Kwan-Young, pionnier du Taekwondo en France, ainsi que Maître Michel CARRON.\n\nRéservez donc dès à présent votre Samedi 14 avril, de 14h30 à 17h30 ! Renseignements et inscriptions auprès d\'Alix Chaselas.','assets/images/event/TW1.jpg'),(5,'2011-04-6','Stage GM Lee Kwan Young','Nous aurons une nouvelle fois l\'honneur d\'accueillir à Olivet Maître LEE Kwan-Young, pionnier du Taekwondo en France, ainsi que Maître Michel CARRON.\n\nRéservez donc dès à présent votre Samedi 14 avril, de 14h30 à 17h30 ! Renseignements et inscriptions auprès d\'Alix Chaselas.','assets/images/event/TW1.jpg'),(6,'2001-04-16','Stage GM Lee Kwan Young','Nous aurons une nouvelle fois l\'honneur d\'accueillir à Olivet Maître LEE Kwan-Young, pionnier du Taekwondo en France, ainsi que Maître Michel CARRON.\n\nRéservez donc dès à présent votre Samedi 14 avril, de 14h30 à 17h30 ! Renseignements et inscriptions auprès d\'Alix Chaselas.','assets/images/event/TW2.jpg'),(7,'2001-04-6','Stage GM Lee Kwan Young','Nous aurons une nouvelle fois l\'honneur d\'accueillir à Olivet Maître LEE Kwan-Young, pionnier du Taekwondo en France, ainsi que Maître Michel CARRON.\n\nRéservez donc dès à présent votre Samedi 14 avril, de 14h30 à 17h30 ! Renseignements et inscriptions auprès d\'Alix Chaselas.','assets/images/event/TW1.jpg'),(8,'2002-12-12','Stage GM Lee Kwan Young','Nous aurons une nouvelle fois l\'honneur d\'accueillir à Olivet Maître LEE Kwan-Young, pionnier du Taekwondo en France, ainsi que Maître Michel CARRON.\n\nRéservez donc dès à présent votre Samedi 14 avril, de 14h30 à 17h30 ! Renseignements et inscriptions auprès d\'Alix Chaselas.','assets/images/event/TW2.jpg'),(9,'2014-02-7','Stage GM Lee Kwan Young','Nous aurons une nouvelle fois l\'honneur d\'accueillir à Olivet Maître LEE Kwan-Young, pionnier du Taekwondo en France, ainsi que Maître Michel CARRON.\n\