és et proposés au regard des participants et Gilles Lagarde avait apporté ses livres «collector» qui regroupent tous les articles qui ont parlé du club de notre village.',NULL),(42,'2018-04-25','Clement TEST','C\'est le feu','assets/uploads/events/5ae0456b1fa57.png'),(43,'2018-04-26','Evenement de oufmamade','C\'est le feu','assets/uploads/events/5ae046271dfe3.png');
